;; **
;;; ## Parametrization
;;; $$p_0 = (-2,5), p_1 = (1,-1), p_2 = (3,3)$$
;; **

;; @@
(def p0 [-2 5])
(def p1 [1 -1])
(def p2 [3 3])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;withered-oasis/p2</span>","value":"#'withered-oasis/p2"}
