;; **
;;; explicit representation @@p(x)@@
;; **

;; @@
(def a1 
  (let [y (mapv second [p0 p1 p2])
  	    M (array [[4 -2 1] [1 1 1] [9 3 1]])]
    (mmul (inverse M) y)))
a1
