;; **
;;; Parametrized representation for @@t_0=0, t_1=1, t_2=2@@
;; **

;; @@
(defn vandermonde [t0 t1 t2]
  (array [[1 t0 (* t0 t0)]
          [1 t1 (* t1 t1)]
          [1 t2 (* t2 t2)]]))
;; @@
